export interface SkillMatch {
  canonicalName: string;    // Display name (e.g. 'React')
  matchedForm: string;      // What was found in text (e.g. 'reactjs')
  type: 'hard' | 'soft' | 'cert';
}

const TYPE_CODES: Record<number, 'hard' | 'soft' | 'cert'> = { 0: 'hard', 1: 'soft', 2: 'cert' };

// -- Build lookup maps at module load ----------------------------------------

export const SKILL_DB: Map<string, SkillRecord> = new Map();
export const SKILL_PHRASES: Set<string> = new Set(); // multi-word lookup keys

for (const entry of RAW_SKILLS) {
  const displayName = entry[0] as string;
  const typeCode = entry[1] as number;
  const type = TYPE_CODES[typeCode] ?? 'hard';
  const record: SkillRecord = { name: displayName, type };

  // Canonical key = lowercase display name
  const canonical = displayName.toLowerCase();
  SKILL_DB.set(canonical, record);
  if (canonical.includes(' ')) SKILL_PHRASES.add(canonical);

  // Aliases (indexes 2+)
  for (let i = 2; i < entry.length; i++) {
    const alias = (entry[i] as string).toLowerCase();
    if (!SKILL_DB.has(alias)) {
      SKILL_DB.set(alias, record);
      if (alias.includes(' ')) SKILL_PHRASES.add(alias);
    }
  }
}

// -- Core extraction function ------------------------------------------------

/**
 * Extracts skills from text by scanning against the skill database.
 * Uses trigram > bigram > unigram matching with consumed-position tracking
 * so that multi-word skills are preferred and words aren't double-counted.
 */
export function extractSkillsFromText(text: string): SkillMatch[] {
  if (!text || !text.trim()) return [];

  const lower = text.toLowerCase();
  // Tokenize: split on whitespace, keep tokens with content
  const tokens = lower
    .replace(/[^a-z0-9+#./\s-]/g, ' ')
    .split(/\s+/)
    .filter(t => t.length > 0);

  const consumed = new Set<number>(); // consumed token positions
  const found = new Map<string, SkillMatch>(); // canonical -> match (dedup)

  // Helper: try to match a phrase at token positions [i..i+len-1]
  function tryMatch(startIdx: number, len: number): boolean {
    // Check no positions consumed
    for (let j = startIdx; j < startIdx + len; j++) {
      if (consumed.has(j)) return false;
    }
    const phrase = tokens.slice(startIdx, startIdx + len).join(' ');
    const record = SKILL_DB.get(phrase);
    if (record) {
      if (!found.has(record.name.toLowerCase())) {
        found.set(record.name.toLowerCase(), {
          canonicalName: record.name,
          matchedForm: phrase,
          type: record.type,
        });
      }
      for (let j = startIdx; j < startIdx + len; j++) consumed.add(j);
      return true;
    }
    return false;
  }

  // Pass 1: 5-grams (long certifications like "AWS Certified Solutions Architect Associate")
  for (let i = 0; i <= tokens.length - 5; i++) {
    tryMatch(i, 5);
  }

  // Pass 2: 4-grams (e.g. "AWS Certified Solutions Architect")
  for (let i = 0; i <= tokens.length - 4; i++) {
    tryMatch(i, 4);
  }

  // Pass 3: trigrams (3-word phrases)
  for (let i = 0; i <= tokens.length - 3; i++) {
    tryMatch(i, 3);
  }

  // Pass 4: bigrams (2-word phrases)
  for (let i = 0; i <= tokens.length - 2; i++) {
    tryMatch(i, 2);
  }

  // Pass 5: unigrams â€” with safeguards against false positives
  // Short tokens (1-2 chars) like "R", "Go", "C" are common in prose
  // ("go ahead", "R&D", "take a C"). Only match these if they are known
  // programming-relevant short forms AND appear as standalone words.
  const SHORT_SKILL_WHITELIST = new Set(['r', 'c', 'c#', 'c++', 'go', 'ai', 'bi', 'ci', 'cd', 'qa', 'ui', 'ux', 'pm', 'ml', 'dl', 'js', 'ts', 'py']);
  for (let i = 0; i < tokens.length; i++) {
    if (consumed.has(i)) continue;
    let token = tokens[i];
    // Strip trailing dots/commas but preserve internal special chars (C++, C#, .NET)
    token = token.replace(/[.,;:!?)]+$/, '');
    if (!token) continue;

    // For very short tokens, only match if whitelisted as a real skill abbreviation
    if (token.length <= 2 && !SHORT_SKILL_WHITELIST.has(token)) continue;

    const record = SKILL_DB.get(token);
    if (record && !found.has(record.name.toLowerCase())) {
      found.set(record.name.toLowerCase(), {
        canonicalName: record.name,
        matchedForm: token,
        type: record.type,
      });
      consumed.add(i);
    }
  }

  return Array.from(found.values());
}
